de:
Besuchen Sie eine authentische Kasematte des Atlantikwalls, die von der Vereinigung Bunker Archéo 44 aus Brevin vollständig in ihrem Originalzustand restauriert wurde.

Saint-Brevin, ein Land der Geschichte und seit den Römern Hüter der Loire-Mündung, ist in seinem gesamten Gebiet reich mit Befestigungsanlagen ausgestattet: feudale Motte, französische Küstenbatterien aus dem 19. und 20. Jahrhundert in Mindin und Le Pointeau, deutsche Bunker des Atlantikwalls.
Der Atlantikwall in Saint-Brevin, das sind 227 Bunker aller Arten und Größen, die während des Krieges in der Gemeinde gebaut wurden, auch auf ihrem ländlichen Gebiet! Eine beachtliche Dichte, die in Frankreich und Europa kaum ihresgleichen hat.
Die Kasematte 105C versetzt die Besucher zurück in die Zeit des Zweiten Weltkriegs. Dieser 1943 von den Deutschen errichtete Bunker war Teil einer umfassenden Verteidigungsanlage in Le Pointeau, die die U-Boot-Basis von Saint-Nazaire vor Angriffen der Alliierten schützen sollte. Mit 2 m Stahlbeton für die Wände und das Dach und 80 cm für die inneren Trennwände wurde es nach den klassischen Normen für deutsche Befestigungen gebaut.

Die Kasematte wurde von den Mitgliedern des Vereins bis ins kleinste Detail in ihren Originalzustand von 1944 zurückversetzt.
Eine schöne Initiative, die es der jüngeren Generation ermöglicht, ein seit über 50 Jahren verschüttetes Erbe zu entdecken.

Eine geführte Besichtigung ist nur mit Reservierung möglich.

Die Casemate kann 10 Personen pro Führung aufnehmen. Die Anmeldung erfolgt online oder im Tourismusbüro von Saint-Brevin oder Paimboeuf.

Online-Reservierung in Kürze.

ACHTUNG: Im Jahr 2023 öffnen die Reservierungen 2 Wochen vor jedem Besuchstermin.


