en:
Visit an authentic casemate of the Atlantic Wall, entirely restored in its original state by the Brevine association Bunker Archéo 44.

Saint-Brevin, land of history and guardian of the Loire estuary since the Romans, is richly endowed with fortifications throughout its territory: feudal motte, French coastal batteries of the 19th and 20th centuries in Mindin and Pointeau, German bunkers of the Atlantic Wall.
The Atlantic Wall in Saint-Brevin is 227 bunkers of all types and sizes built in the commune during the war, including on its rural territory! A considerable density which has few equivalents in France and in Europe.
Casemate 105C takes visitors back to the heart of the Second World War. This blockhouse, built by the Germans in 1943, was part of a vast defensive system installed at Le Pointeau to protect the Saint-Nazaire submarine base from Allied attacks. With 2m of reinforced concrete for the walls and the roof and 80cm for the interior partitions, it was built according to the classic standards of German fortifications.

This casemate has been restored in its original state of 1944, down to the smallest details, by the members of the association.
A great initiative that allows the younger generation to discover a heritage that has been buried for over 50 years.

A guided tour by reservation only.

The Casemate can accommodate 10 people per visit, registration is made online, or at the Tourist Office of Saint-Brevin or Paimboeuf.

