La casamatta è stata riportata allo stato originale del 1944, fin nei minimi dettagli, dai membri dell'associazione.
Si tratta di una grande iniziativa che permette alle giovani generazioni di scoprire un patrimonio rimasto sepolto per oltre 50 anni.

